import React, {useState} from 'react'
import Flexview from 'react-flexview'
import {Form, FormGroup, Button, ControlLabel, FormControl } from 'rsuite'

const {Column, HeaderCell, Cell} = Table


export const List = () => {

    const [formValue, setFormValue] = useState({item: ''})

    // const onSubmit = () => {
    //     setFormValue({

    //     })
    // }


    return (

    <Flexview vAlignContent='center' hAlignContent='center'>
    <Form onChange={setFormValue} value={formValue}>
        <h1>Add Your List Items: </h1>
        <FormGroup>
            <ControlLabel>To Do Item</ControlLabel>
            <FormControl 
            name='item'
            />
        </FormGroup>
        <FormGroup>
            <Button  appearance="ghost">Submit</Button>
        </FormGroup>
    </Form>
    <Table>
        <Column>
        <HeaderCell>Item</HeaderCell>
        <Cell dataKey='item'/>
        </Column>
    </Table>
    </Flexview>

    )
}

export default List
